import React, { 
  Component 
} 
from 'react';

import {
  Jumbotron,
  VerticalLine,
  Display,
  Button,
  Grid
}
from "./components/bootstrap";

class App extends Component {
  render() {
    const arr = [
        7, 8, 9, "/",
        4, 5, 6, "X",
        1, 2, 3, "-",
        0, ".", "=", "+"

      ];
    return (
      <Jumbotron width="20rem">
        <Display text="asdasd"/>
        <VerticalLine/>    
        <Grid columns={4}>
          {arr.map(item => <Button name={item}/>)}
        </Grid>
      </Jumbotron>
    );
  }
}

export default App;
